import React from 'react';
import { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import './SearchBar.css'

const SearchBar = () => {

  function handle(e){
    if(e.key === "Enter"){
      alert('enter was pressed');
    }
    return false;
  }

  return (
    <div>
        <input 
        placeholder='Search...' 
        value='' 
        id='search-box' 
        onKeyDown={handle()}
        />
    </div>
  )
}

export default SearchBar
